t-align:justify" class="font_8"><span style="font-size:20px">- AquisiÃ§Ã£o da notÃ­cia do crime</span></p><p style="font-size:20px;text-align:justify" class="font_8"><span style="font-size:20px">- InquÃ©rito</span></p><p style="font-size:20px;text-align:justify" class="font_8"><span style="font-size:20px">- InstruÃ§Ã£o</span></p><p style="font-size:20px;text-align:justify" class="font_8"><span style="font-size:20px">- Julgamento</span></p><p style="font-size:20px;text-align:justify" class="font_8"> </p><p style="font-size:20px;text-align:justify" class="font_8"><span style="font-weight:bold"><span style="font-size:20px">1) AquisiÃ§Ã£o da notÃ­cia do crime</span></span></p><p style="text-align:justify" class="font_8"><span style="font-size:20px">O MinistÃ©rio PÃºblico obtÃªm as notÃ­cias do crime por 3 meios essenciais:</span></p><p style="font-size:20px;text-align:justify" class="font_8"><span style="font-size:20px">1. por conhecimento prÃ³prio;</span></p><p style="font-size:20px;text-align:justify" class="font_8"><span style="font-size:20px">2. denÃºncia feita aos Ã³rgÃ£os de polÃ­cia criminal e transmitida posteriormente ao MinistÃ©rio PÃºblico mediante auto de notÃ­cia;</span></p><p style="font-size:20px;text-align:justify" class="font_8"><span style="font-size:20px">3. denÃºncia feita verbalmente ou por escrito ao MinistÃ©rio PÃºblico tanto por cidadÃ£o como por funcionÃ¡rio pÃºblico.</span></p><p style="font-size:20px;text-align:justify" class="font_8"> </p><p style="font-size:20px;text-align:justify" class="font_8"><span style="font-weight:bold"><span style="font-size:20px">2) InquÃ©rito</span></span></p><p style="font-size:20px;text-align:justify" class="font_8"><span style="font-size:20px">O inquÃ©rito destina-se a investigar a existÃªncia de um crime, determinar os seus agentes e responsabilidade s dos mesmos assim como descobrir e recolher a s provas para se chegar Ã  decisÃ£o sobre uma eventual acusaÃ§Ã£o pelo MinistÃ©rio PÃºblico.</span></p><p style="font-size:20px;text-align:justify" class="font_8"><span style="font-size:20px">Compete ao MinistÃ©rio PÃºblico dirigir o inquÃ©rito, podendo este ordenar e dirigir os Ã³rgÃ£os de polÃ­cia criminal para proceder Ã s investigaÃ§Ãµes bem co mo fiscalizar a legalidade das mesmas.</span></p><p style="font-size:20px;text-align:justify" class="font_8"><span style="font-size:20px">Em regra, o prazo mÃ¡ximo do inquÃ©rito Ã© de 6 a 8 meses, terminado o qual o MinistÃ©rio PÃºblico decide sobre uma acusaÃ§Ã£o ou arquivamento do inquÃ©rito, conforme a suficiÃªncia ou nÃ£o das provas obtidas.</span></p><p style="font-size:20px;text-align:justify" class="font_8"><span style="font-size:20px">O MinistÃ©rio PÃºblico deve notificar ou comunicar ao arguido, assistente, ofendido, etc., sobre o seu despacho de acusaÃ§Ã£o ou de arquivamento.</span></p><p style="font-size:20px;text-align:justify" class="font_8"><span style="font-size:20px">O inquÃ©rito pode ser reaberto por ordem do MinistÃ©rio PÃºblico se surgirem novos elementos de prova que invalidem os fundamentos invocados no despacho de arquivamento.</span></p><p style="font-size:20px;text-align:justify" class="font_8"> </p><p style="font-size:20px;text-align:justify" class="font_8"><span style="font-weight:bold"><span style="font-size:20px">3) InstruÃ§Ã£o</span></span></p><p style="text-align:justify" class="font_8"><span style="font-size:20px">Ao Juiz da InstruÃ§Ã£o Criminal compete dirigir a instruÃ§Ã£o que visa a comprovaÃ§Ã£o judicial da decisÃ£o do MinistÃ©rio PÃºblico sobre uma acusaÃ§Ã£o ou arquivamento do inquÃ©rito de modo a melhor proteger os interesses das partes de um processo penal.</span></p><p style="font-size:20px;text-align:justify" class="font_8"><span style="font-size:20px">A instruÃ§Ã£o Ã© uma fase facultativa num processo penal, pois sÃ³ existe se for requerida pelos interessados.</span></p><p style="font-size:20px;text-align:justify" class="font_8"><span style="text-decoration:underline"><span style="font-size:20px">Em que circunstÃ¢ncias Ã© que se pode requerer a instruÃ§Ã£o?</span></span></p><p style="font-size:20px;text-align:justify" class="font_8"><span style="font-size:20px">(1) em caso da acusaÃ§Ã£o deduzida pelo MinistÃ©rio PÃºblico</span></p><p style="font-size:20px;text-align:justify" class="font_8"><span style="font-size:20px">O arguido pode requerer a instruÃ§Ã£o no prazo de 5 dias a contar da notificaÃ§Ã£o sobre a acusaÃ§Ã£o do MinistÃ©rio PÃºblico.</span></p><p style="font-size:20px;text-align:justify" class="font_8"><span style="font-size:20px">(2) em caso do arquivamento do inquÃ©rito</span></p><p style="font-size:20px;text-align:justify" class="font_8"><span style="font-size:20px">O ofendido ou assistente pode requerer a instruÃ§Ã£o no prazo de 15 dias a contar da notificaÃ§Ã£o pelo MinistÃ©rio PÃºblico s obre o seu despacho de arquiva mento ou de recusa Ã  reabertura do inquÃ©rito.</span></p><p style="font-size:20px;text-align:justify" class="font_8"><span style="font-size:20px">A instruÃ§Ã£o sÃ³ existe no processo comum, nÃ£o podendo ser requerida no processo sumÃ¡rio ou processo sumarÃ­ssimo.</span></p><p style="font-size:20px;text-align:justify" class="font_8"><span style="font-size:20px">O requerimento da instruÃ§Ã£o nÃ£o estÃ¡ sujeito a formalidades especiais mas de vem ser nele escritos sucintamente a discordÃ¢ncia e respectivos fundamentos legais.</span></p><p style="font-size:20px;text-align:justify" class="font_8"> </p><p style="font-size:20px;text-align:justify" class="font_8"><span style="font-weight:bold"><span style="font-size:20px">4) Julgamento</span></span></p><p style="font-size:20px;text-align:justify" class="font_8"><span style="font-size:20px">ApÃ³s acusaÃ§Ã£o deduzida pelo MinistÃ©rio PÃºblico, o processo Ã© entregue ao Tribunal para o julgamento. Nesta fase, cabe ao MinistÃ©rio PÃºblico sustentar a acusaÃ§Ã£o em juÃ­zo e fiscalizar a legalidade do respectivo procedimento.</span></p><p style="font-size:20px;text-align:justify" class="font_8"><span style="font-size:20px">O Tribunal indica com a maior brevidade a data, hora e local para a audiÃªncia e notifica do despacho da audiÃªncia ao MinistÃ©rio PÃºblico, arguido, assistente, parte civil e aos seus representantes. O Tribunal nomeia oficiosamente um defensor para o arguido se este ainda nÃ£o tive r constituÃ­do o seu defensor.</span></p><p style="font-size:20px;text-align:justify" class="font_8"><span style="font-size:20px">A audiÃªncia Ã© uma fase importante no julgamento. A lei estabelece que, em geral, a audiÃªncia deve ser pÃºblica .</span></p><p style="font-size:20px;text-align:justify" class="font_8"><span style="font-size:20px">PorÃ©m, atendendo a circunstÃ¢ncias especiais (por exemplo casos em que as circunstÃ¢ncias de fato possam vir a prejudicar gravemente a dignidade humana e a moral pÃºblica, tais como crimes sexuais em que as vÃ­timas sejam os menores), o Juiz que preside Ã  audiÃªncia pode decidir a proibiÃ§Ã£o ou restriÃ§Ã£o da presenÃ§a do pÃºblico.</span></p><p style="font-size:20px;text-align:justify" class="font_8"><span style="font-size:20px">Finda a audiÃªncia, o Tribunal procede Ã  leitura da sentenÃ§a imediatamente ou no momento subsequente. Quem nÃ£o se conforma com a sentenÃ§a, incluindo o MinistÃ©rio PÃºblico, arguido, assistente, parte civil, etc., pode interpor recurso junto do Tribunal de hierarquia superior (Tribunal de Segunda ou de Ãšltima InstÃ¢ncia).</span></p><p style="font-size:20px" class="font_8"> </p></div></div></div><div id="comp-jblfo6x6_SinglePostMediaTop_MediaPost__0_0_def_22_true" style="position:relative;display:block;-webkit-box-orient:vertical;-webkit-flex-direction:column;-ms-flex-direction:column;flex-direction:column;width:100%;box-sizing:border-box" class=" flex_vbox"><div orientation="vertical" id="comp-jblfo6x6_SinglePostMediaTop_MediaPost__0_0_def_30_child" style="box-sizing:border-box;min-height:20px"></div></div></div><div orientation="horizontal" id="comp-jblfo6x6_SinglePostMediaTop_Media