"https:","host":"www.entendeudireito.com.br","hostname":"www.entendeudireito.com.br","port":"","path":"\/single-post\/2019\/05\/21\/Fases-do-Processo-Penal","search":"","hash":"","query":{},"url":"https:\/\/www.entendeudireito.com.br\/"},"userWarmup":{},"runtime":{"data":{"behaviors_data":{},"connections_data":{},"document_data":{},"design_data":{},"mobile_hints":{},"component_properties":{},"breakpoints_data":{},"layout_data":{},"theme_data":{}},"state":{}},"wixappsCoreWarmup":{"appbuilder":{},"faq":{},"news":{},"menu":{},"blog":{"descriptor":{},"categories":{"countedCategories":0,"postCountById":{},"categories":[],"orderedCategories":[],"categoryById":{}},"postCategoryResolutionNeedById":{},"dataItem-jblfo6x61_extraData":{"items":[{"_type":"MediaPost","mediaText":{"_type":"wix:MediaRichText","text":"<hatul class=\"align-center font_8\"><img alt=\"\" height=\"459\" src=\"\/\/static.wixstatic.com\/media\/243738_bf96d1a13fe94a3399a4030a95fe390a~mv2_d_2550_2491_s_4_2.jpg\/v1\/fill\/w_470,h_459\/243738_bf96d1a13fe94a3399a4030a95fe390a~mv2_d_2550_2491_s_4_2.jpg\" width=\"469.5\" wix-comp=\"{&quot;id&quot;:&quot;innercomp_txtMediacqk&quot;,&quot;dataQuery&quot;:&quot;txtMediacqk&quot;,&quot;propertyQuery&quot;:&quot;txtMediacqk&quot;,&quot;componentType&quot;:&quot;wysiwyg.viewer.components.WPhoto&quot;,&quot;styleId&quot;:&quot;&quot;,&quot;skin&quot;:&quot;wysiwyg.viewer.skins.photo.NoSkinPhoto&quot;,&quot;display&quot;:&quot;block&quot;,&quot;marginLeft&quot;:&quot;auto&quot;,&quot;marginRight&quot;:&quot;auto&quot;,&quot;width&quot;:0.77,&quot;src&quot;:&quot;\/\/static.wixstatic.com\/media\/243738_bf96d1a13fe94a3399a4030a95fe390a~mv2_d_2550_2491_s_4_2.jpg&quot;,&quot;isFullSize&quot;:false}\"><\/hatul><hatul class=\"font_8\"><span>&nbsp;<\/span><\/hatul><hatul style=\"font-size: 20px;\" class=\"font_8\">&nbsp;<\/hatul><hatul style=\"font-size: 20px; text-align: justify;\" class=\"font_8\"><span style=\"font-size:20px;\">Em regra, o processo penal Ã© composto por 4 fases essenciais:<\/span><\/hatul><hatul style=\"font-size: 20px; text-align: justify;\" class=\"font_8\"><span style=\"font-size:20px;\">- AquisiÃ§Ã£o da notÃ­cia do crime<\/span><\/hatul><hatul style=\"font-size: 20px; text-align: justify;\" class=\"font_8\"><span style=\"font-size:20px;\">- InquÃ©rito<\/span><\/hatul><hatul style=\"font-size: 20px; text-align: justify;\" class=\"font_8\"><span style=\"font-size:20px;\">- InstruÃ§Ã£o<\/span><\/hatul><hatul style=\"font-size: 20px; text-align: justify;\" class=\"font_8\"><span style=\"font-size:20px;\">- Julgamento<\/span><\/hatul><hatul style=\"font-size: 20px; text-align: justify;\" class=\"font_8\">&nbsp;<\/hatul><hatul style=\"font-size: 20px; text-align: justify;\" class=\"font_8\"><span style=\"font-weight:bold;\"><span style=\"font-size:20px;\">1) AquisiÃ§Ã£o da notÃ­cia do crime<\/span><\/span><\/hatul><hatul style=\"text-align: justify;\" class=\"font_8\"><span style=\"font-size: 20px;\">O MinistÃ©rio PÃºblico obtÃªm&nbsp;as notÃ­cias do crime por 3 meios essenciais:<\/span><\/hatul><hatul style=\"font-size: 20px; text-align: justify;\" class=\"font_8\"><span style=\"font-size:20px;\">1. por conhecimento prÃ³prio;<\/span><\/hatul><hatul style=\"font-size: 20px; text-align: justify;\" class=\"font_8\"><span style=\"font-size:20px;\">2. denÃºncia feita aos Ã³rgÃ£os de polÃ­cia criminal e transmitida posteriormente ao MinistÃ©rio PÃºblico mediante auto de notÃ­cia;<\/span><\/hatul><hatul style=\"font-size: 20px; text-align: justify;\" class=\"font_8\"><span style=\"font-size:20px;\">3. denÃºncia feita verbalmente ou por escrito ao MinistÃ©rio PÃºblico tanto por cidadÃ£o como por funcionÃ¡rio pÃºblico.<\/span><\/hatul><hatul style=\"font-size: 20px; text-align: justify;\" class=\"font_8\">&nbsp;<\/hatul><hatul style=\"font-size: 20px; text-align: justify;\" class=\"font_8\"><span style=\"font-weight:bold;\"><span style=\"font-size:20px;\">2) InquÃ©rito<\/span><\/span><\/hatul><hatul style=\"font-size: 20px; text-align: justify;\" class=\"font_8\"><span style=\"font-size:20px;\">O inquÃ©rito destina-se a investigar a existÃªncia de um crime, determinar os seus agentes e responsabilidade s dos mesmos assim como descobrir e recolher a s provas para se chegar Ã  decisÃ£o sobre uma eventual acusaÃ§Ã£o pelo MinistÃ©rio PÃºblico.<\/span><\/hatul><hatul style=\"font-size: 20px; text-align: justify;\" class=\"font_8\"><span style=\"font-size:20px;\">Compete ao MinistÃ©rio PÃºblico dirigir o inquÃ©rito, podendo este ordenar e dirigir os Ã³rgÃ£os de polÃ­cia criminal para proceder Ã s investigaÃ§Ãµes bem co mo fiscalizar a legalidade das mesmas.<\/span><\/hatul><hatul style=\"font-size: 20px; text-align: justify;\" class=\"font_8\"><span style=\"font-size:20px;\">Em regra, o prazo mÃ¡ximo do inquÃ©rito Ã© de 6 a 8 meses, terminado o qual o MinistÃ©rio PÃºblico decide sobre uma acusaÃ§Ã£o ou arquivamento do inquÃ©rito, conforme a suficiÃªncia ou nÃ£o das provas obtidas.<\/span><\/hatul><hatul style=\"font-size: 20px; text-align: justify;\" class=\"font_8\"><span style=\"font-size:20px;\">O MinistÃ©rio PÃºblico deve notificar ou comunicar ao arguido, assistente, ofendido, etc., sobre o seu despacho de acusaÃ§Ã£o ou de arquivamento.<\/span><\/hatul><hatul style=\"font-size: 20px; text-align: justify;\" class=\"font_8\"><span style=\"font-size:20px;\">O inquÃ©rito pode ser reaberto por ordem do MinistÃ©rio PÃºblico se surgirem novos elementos de prova que invalidem os fundamentos invocados no despacho de arquivamento.<\/span><\/hatul><hatul style=\"font-size: 20px; text-align: justify;\" class=\"font_8\">&nbsp;<\/hatul><hatul style=\"font-size: 20px; text-align: justify;\" class=\"font_8\"><span style=\"font-weight:bold;\"><span style=\"font-size:20px;\">3) InstruÃ§Ã£o<\/span><\/span><\/hatul><hatul style=\"text-align: justify;\" class=\"font_8\"><span style=\"font-size:20px;\">Ao Juiz&nbsp;da InstruÃ§Ã£o Criminal compete dirigir a instruÃ§Ã£o que visa a comprovaÃ§Ã£o judicial da decisÃ